*/
import { awGuidanceMessageRenderFunction } from 'js/AwGuidanceMessageService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwGuidanceMessageService', () => import('js/AwGuidanceMessageService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awGuidanceMessageRenderFunction",
            "deps": "js/AwGuidanceMessageService"
        },
        "closeMessage": {
            "actionType": "JSFunction",
            "method": "closeGuidanceMessage",
            "outputData": {
                "hideMessage": ""
            },
            "deps": "js/AwGuidanceMessageService"
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "i18n": {
        "generalInfo": [
            "UIMessages"
        ],
        "warningInfo": [
            "UIMessages"
        ],
        "ErrorInfo": [
            "UIMessages"
        ],
        "successInfo": [
            "UIMessages"
        ],
        "closeMessage": [
            "UIMessages"
        ]
    },
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "message": {
            "type": "message"
        },
        "closable": {
            "type": "boolean"
        },
        "banner-style": {
            "type": "boolean"
        },
        "show-icon": {
            "type": "boolean"
        },
        "show-type": {
            "type": "boolean"
        },
        "icon": {
            "type": "string"
        }
    },
    "_viewModelId": "AwGuidanceMessage",
    "_uniqueViewModelId": "AwGuidanceMessage",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awGuidanceMessageRenderFunction, undefined, ctxImportObj );

export default Component;
